import { createAction, addReducer } from "@webiny/app-page-builder/editor/redux";
var PREFIX = "[Spacer]";
export var SPACER_RESIZE_START = "".concat(PREFIX, " Resize start");
export var SPACER_RESIZE_END = "".concat(PREFIX, " Resize end");
export var resizeStart = createAction(SPACER_RESIZE_START);
export var resizeStop = createAction(SPACER_RESIZE_END);
